	const carouselRef = useRef();
	const length = list.length;

	const questionList = list.map((obj) => (
		<Question q={obj.q} a1={obj.a1} a2={obj.a2} key={obj.q} />
	));

	const nextQuestionFunc = () => {
		carouselRef.current.next();
	};

	useEffect(() => {
		console.log(questionList);
	}, []);

	return (
		<>
			<Row>
				<h1>hello dog!</h1>
